import React, {Component} from 'react';
import './App.css';

class HomeScreenButton extends Component {
    constructor(props) {
        super(props);
        this.props = props;
    }

    render() {
        return (
            <button
                onClick={this.props.onClick}
                className="HomeScreenButton"
            >
                <img
                    src={this.props.src}
                    alt={this.props.text}
                />
                <p>{this.props.text}</p>
            </button>
        );
    }
}

export default HomeScreenButton;
